import Banner  from "./Banner";
import Skill  from "./Skill";
import ProjectSection from "./ProjectSection";
import Contact from "./Contact";
import Progress from "./Progress";
import Footer from "./Footer";
import './App.css';
class App extends Component{
    render(){
        return (


        <>
           <Navigation/>
           <Banner/>
           <Skill/>
           <Progress/>
           <ProjectSection/>
           <Contact/>
           <Footer/>
        </>
    )
}
}


export default App;
